  input: 'TEXT,F3XA,,"This is in response to your letter of February 2, 2007, regarding
    our 30-Day Post-General Report (10/19/06 - 11/27/06).     - For any exempt activity
    that is a Federal Election Activity and a public communication, we have provided
    the name of any candidate to whom the activity should be attributed on Schedule
    B for Line 30b.    - The committee is aware that 11CFR300.34 prohibits our using
    any funds transferred from another party committee as the federal component of
    any allocated Federal Election Activity.     The federal component of FEA disclosed
    on Schedule H6 for Line 30a totals $15,417.29. During this period, the committee
    raised $27,474.65 in contributions from individuals, $43,567.00 in contributions
    from other political committees, and $50,174.28 in joint fundraising proceeds
    eligible to be used for Levin activities--almost eight times the amount of self-raised
    funds needed to pay the federal component of allocated FEA.     Between 10/19
    and 10/25, the date the first national party transfer was received, the committee
    raised $52,296.97 in funds that could be used for Levin activities. Between 10/26
    and 10/30, the date of the next national party transfer, the committee had raised
    another $25,035.81 in funds that could be used for Levin activities; between 10/31
    and 11/1, the date of the next national party transfer, $11,030.00 more in eligible
    funds was raised; and between 11/2 and 11/27, the date of the last national party
    transfer disclosed on this report, the committee raised $10,802.00 more in eligible
    funds. These figures do not take into account any amount of funds eligible to
    be used for Levin activities that were already in hand at the beginning of the
    period.     No transfers-in from any other party committee were used for allocated
    Federal Election Activity. When paying for a potentially allocable Federal Election
    Activity, the committee analyzes its deposits and account balances to determine
    whether it has sufficient self-raised federal funds to allocate the activity.
    The committee generally assumes that its balances are composed of its most recent
    deposits. If the committee determines that it does not have sufficient self-raised
    funds at the time a payment is made, it uses 100% federal funds to pay for activities
    that would otherwise be allocable FEA.    - We have corrected the column B totals
    on the Schedule L Aggregation Page. This problem was caused by incorrect coding
    of three Levin contributions: $1,000 that was reported on a previous report; and
    $1,000 and $25 that should have appeared on this report but originally did not
    because of entry errors. We will also be amending our January 31 year-end report
    to reflect these corrections.     Please advise if any additional information
    is required.",'
